import "./Projects.css";
import calculator from "./images/Calculator.png";

const CalculatorProject = (props) => {
  return(
    <div>
      <img src={calculator} alt="Calculator" className="img-responsive project-img" />
    </div>
  );
};

export default CalculatorProject;
